angular.module("templates",[]).run(["$templateCache",function(r){r.put("components/character-card/character-card.html",'<img class="ui image" ng-src="{{image.character}}" on-image-load="calculateFontSize()">\r\n<div class="content">\r\n	<div class="stars">\r\n		<img ng-repeat="star in stars" ng-src="{{image.star}}">\r\n	</div>\r\n	<div class="name" ng-style="{\'font-size\': fontSize}">{{character.name.en}}</div>\r\n</div>'),r.put("components/character-chains-tab/character-chains-tab.html",'<div ng-show="!chains">\r\n	This character has no chains.\r\n</div>\r\n\r\n<div ng-repeat="chain in chains">\r\n	<div class="chain-wrapper">\r\n		<h5 class="ui header">{{chain.effect}}</h5>\r\n		<div ng-repeat="characterId in chain.characterIds" class="card-wrapper">\r\n			<a ui-sref="character-details({ characterId: characterId })">\r\n				<character-card ng-model="characterId" class="ui link"></character-card>\r\n			</a>\r\n		</div>\r\n	</div>\r\n	<div class="ui divider"></div>\r\n</div>'),r.put("components/character-evolution-tab/character-evolution-tab.html",'<div class="ui two column grid">\r\n	<div class="eight wide tablet six wide computer column">\r\n		<a ui-sref="character-details({ characterId: evolutions[0].preResult })">\r\n			<character-card ng-model="evolutions[0].preResult" class="ui link"></character-card>\r\n		</a>\r\n	</div>\r\n	<div ng-repeat="evolution in evolutions" class="column row">\r\n		<div class="eight wide tablet six wide computer column">\r\n			<a ui-sref="character-details({ characterId: evolution.result })">\r\n				<character-card ng-model="evolution.result" class="ui link"></character-card>\r\n			</a>\r\n		</div>\r\n		<div class="column">\r\n			<h5 class="ui header">Materials</h5>\r\n			<div ng-repeat="material in evolution.materials">\r\n				x{{material.count}}\r\n				<a ui-sref="character-details({ characterId: material.character.id })">{{material.character.name.en}}</a>\r\n			</div>\r\n			<div>\r\n				{{evolution.cost}} Gold\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>'),r.put("components/character-skills-tab/character-skills-tab.html",'<div ng-if="character.skills.ace" class="ui segment">\r\n	<character-skill ng-model="character.skills.ace"></character-skill>\r\n</div>\r\n\r\n<div ng-if="character.skills.active" class="ui segment">\r\n	<character-skill ng-model="character.skills.active"></character-skill>\r\n</div>\r\n\r\n<div ng-if="character.skills.passives.length > 0" class="ui segments">\r\n	<div ng-repeat="skill in character.skills.passives" class="ui segment">\r\n		<character-skill ng-model="skill"></character-skill>\r\n	</div>\r\n</div>'),r.put("components/character-skill/character-skill.html",'<h5 ng-if="skill.name" class="ui header">[{{skill.type}}] {{skill.name.en}}</h5>\r\n<p ng-show="skill.effects.length > 1" class="ui labels">\r\n	<a ng-repeat="effect in skill.effects track by $index" ng-click="$parent.levelIndex = $index" class="ui small grey label" ng-class="{ basic: $parent.levelIndex !== $index }">\r\n		{{effect.level}}\r\n	</a>\r\n</p>\r\n<p>\r\n	{{skill.effects[levelIndex].description.en}}\r\n</p>\r\n<div ng-if="skill.cost > 0 || cooldown.value > 0" class="ui labels">\r\n	<span ng-show="skill.cost > 0" class="ui blue label"><i class="lightning icon"></i> {{skill.cost}}</span>\r\n	<span ng-show="cooldown.value > 0" class="ui orange label"><i class="wait icon"></i> {{cooldown.value}} {{cooldown.unit}}</span>\r\n</div>'),r.put("components/character-stats-tab/character-stats-tab.html",'<div ng-show="character.isManager">\r\n	Managers don\'t have stats.\r\n</div>\r\n\r\n<div ng-if="character.isPlayer || character.isOther">\r\n	<div ng-show="character.isPlayer">\r\n		<strong>Level</strong>\r\n		<div class="ui small labels">\r\n			<a ng-repeat="level in statOptionValues.level" ng-click="statOptions.level = level" class="ui teal label" ng-class="{ basic: statOptions.level !== level }">{{level}}</a>\r\n		</div>\r\n		\r\n		<strong>Superb</strong>\r\n		<div class="ui small labels">\r\n			<a ng-repeat="superb in statOptionValues.superb" ng-click="statOptions.superb = superb" class="ui orange label" ng-class="{ basic: statOptions.superb !== superb }">{{superb}}</a>\r\n		</div>\r\n		\r\n		<strong>Bonus Stats</strong>\r\n		<div class="ui small labels">\r\n			<a ng-repeat="bonusStat in [0, 40]" ng-click="setBonusStats(bonusStat)" class="ui purple label" ng-class="{ basic: getBonusStats() !== bonusStat }">+ {{bonusStat}}</a>\r\n		</div>\r\n		<div class="ui divider"></div>\r\n	</div>\r\n	\r\n	<div ng-repeat="(key, stat) in stats">\r\n		<div class="stat-meta">\r\n			<span class="ui small {{stat.color}} label">{{stat.name}}: {{stat.value}}</span>\r\n			<span ng-show="character[key].ranking" class="ui small {{stat.color}} basic label">Rank: {{character[key].ranking}}</span>\r\n			<div class="ui mini labeled input">\r\n				<div class="ui {{stat.color}} left corner label">\r\n					<i class="plus icon"></i>\r\n				</div>\r\n				<input ng-model="statOptions.bonus[key]" type="number">\r\n			</div>\r\n		</div>\r\n		<div class="ui tiny {{stat.color}} progress">\r\n			<div class="bar" style="transition-duration: 300ms; width: {{stat.value / 3.5}}%"></div>\r\n		</div>\r\n	</div>\r\n	<div class="ui divider"></div>\r\n	\r\n	<div class="ui grid">\r\n		<div class="sixteen wide tablet eight wide computer column">\r\n			<table class="ui very basic small unstackable compact table secondary-stats">\r\n				<tbody>\r\n					<tr ng-repeat="row in secondaryStats">\r\n						<td ng-repeat-start="stat in row" class="six wide"><strong>{{stat.name}}</strong></td>\r\n						<td ng-repeat-end class="two wide">\r\n							<span class="ui basic small label" ng-class="{ blue: stat.positionBuff }">\r\n								{{stat.value}}\r\n							</span>\r\n						</td>\r\n						<td ng-if="row.length === 1" colspan="2"></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n		</div>\r\n		\r\n		<div class="sixteen wide tablet eight wide computer column">\r\n			<div class="ui segment positions">\r\n				<div class="ui three column center aligned grid">\r\n					<div ng-repeat="row in positions track by $index" class="row">\r\n						<div ng-repeat="position in row track by $index" class="column">\r\n							<span ng-show="!position" class="ui circular label"></span>\r\n							<a ng-show="position" ng-click="statOptions.position = (statOptions.position === position) ? null : position" class="ui medium label" ng-class="{ basic: statOptions.position !== position , orange: position.main, yellow: !position.main }">\r\n								{{position.name}}\r\n								<i ng-show="statOptions.position === position" class="delete icon"></i>\r\n							</a>\r\n						</div>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>'),r.put("components/multi-select/multi-select.html",'<div class="ui labels">\r\n	<a ng-repeat="option in options" ng-click="selectOption(option)" class="ui label" ng-class="{ image: option.image, black: isOptionSelected(option) }">\r\n		<img ng-if="option.image" ng-src="{{option.image}}">\r\n		<i ng-if="option.icon" class="{{option.icon}} icon"></i>\r\n		<span ng-show="option.value === true">Yes</span>\r\n		<span ng-show="option.value === false">No</span>\r\n		<span ng-show="option.value !== true && option.value !== false">{{option.value}}</span>\r\n	</a>\r\n</div>'),r.put("routes/character-details/character-details.html",'<div id="character-details" ng-if="ctrl.character">\r\n	<h1 class="ui header">{{ctrl.character.name.en}}</h1>\r\n	\r\n	<div class="ui stackable two column grid">\r\n		<div class="six wide tablet five wide computer column">\r\n			<character-card ng-model="ctrl.character"></character-card>\r\n			<div class="ui divider"></div>\r\n			\r\n			<div class="ui labels">\r\n				<span class="ui image label">\r\n					<img ng-src="{{ctrl.imageIcons.gender}}">\r\n					{{ctrl.character.gender}}\r\n				</span>\r\n				<span class="ui image label">\r\n					<img ng-src="{{ctrl.imageIcons.element}}">\r\n					{{ctrl.character.element}}\r\n				</span>\r\n				<span ng-show="ctrl.character.type" class="ui image label">\r\n					<img ng-src="{{ctrl.imageIcons.type}}">\r\n					{{ctrl.character.type}}\r\n				</span>\r\n				<span ng-show="ctrl.character.weatherImmunity" class="ui image label">\r\n					<img ng-src="{{ctrl.imageIcons.weatherImmunity}}">\r\n					{{ctrl.character.weatherImmunity}}\r\n				</span>\r\n				<span class="ui label">\r\n					<i class="star icon"></i>\r\n					{{ctrl.character.value}}\r\n				</span>\r\n				<span ng-show="ctrl.character.isSpecial" class="ui image label">\r\n					<img ng-src="{{ctrl.imageIcons.special}}">\r\n					Special\r\n				</span>\r\n				<div class="ui divider"></div>\r\n			</div>\r\n			\r\n			<div ng-if="ctrl.character.stoneElements.length > 0">\r\n				<h4 class="ui header">Spirit Stones</h4>\r\n				<div class="ui labels">\r\n					<span ng-repeat="element in ctrl.character.stoneElements track by $index" class="ui image label">\r\n						<img ng-src="{{ctrl.imageIcons.stoneElements[$index]}}">\r\n						{{element}}\r\n					</span>\r\n				</div>\r\n				<div class="ui divider"></div>\r\n			</div>\r\n		</div>\r\n		\r\n		<div class="ten wide tablet eleven wide computer column">\r\n			<h4 class="ui header">Story</h4>\r\n			<p>{{ctrl.character.story.en}}</p>\r\n			\r\n			<div class="ui secondary pointing four item menu">\r\n				<a ng-repeat="(key, tab) in ctrl.tabs" ng-click="tab.select()" class="item" ng-class="{ active: tab.isSelected() }">\r\n					{{tab.name}}\r\n				</a>\r\n			</div>\r\n			\r\n			<character-stats-tab ng-if="ctrl.selectedTab.stats" ng-model="ctrl.character"></character-stats-tab>\r\n			<character-skills-tab ng-if="ctrl.selectedTab.skills" ng-model="ctrl.character"></character-skills-tab>\r\n			<character-evolution-tab ng-if="ctrl.selectedTab.evolution" ng-model="ctrl.character"></character-evolution-tab>\r\n			<character-chains-tab ng-if="ctrl.selectedTab.chains" ng-model="ctrl.character"></character-chains-tab>\r\n			\r\n		</div>\r\n	</div>\r\n</div>'),r.put("routes/characters/characters.html",'<div id="characters">\r\n  <h1 class="ui header">Characters</h1>\r\n  <h3 class="ui header">Name</h3>\r\n  <div class="ui fluid action input" ng-class="{ icon: ctrl.filterValues.name }">\r\n    <input ng-model="ctrl.filterValues.name" ng-model-options="{ debounce: 500 }" type="text">\r\n    <button ng-click="advancedSearch = !advancedSearch" class="ui right labeled icon button">\r\n      <i class="angle icon" ng-class="{ down: !advancedSearch, up: advancedSearch }"></i>\r\n      <span ng-hide="advancedSearch">Show Filters</span>\r\n      <span ng-show="advancedSearch">Hide Filters</span>\r\n    </button>\r\n  </div>\r\n  <br>\r\n  \r\n  <div ng-show="!advancedSearch" class="ui labels">\r\n    <span ng-repeat="(key, filter) in ctrl.filters" ng-show="ctrl.filterValues[key]" class="ui label">\r\n      {{filter.name}}: {{ctrl.formatValue(ctrl.filterValues[key])}}\r\n      <i class="delete icon" ng-show="!filter.required" ng-click="ctrl.filterValues[key] = undefined"></i>\r\n    </span>\r\n    \r\n    <span ng-repeat="(key, filter) in ctrl.skillFilters" ng-show="ctrl.filterValues.skill[key]" class="ui label">\r\n      {{filter.name}}: "{{ctrl.filterValues.skill[key]}}"\r\n      <i class="delete icon" ng-click="ctrl.filterValues.skill[key] = undefined"></i>\r\n    </span>\r\n  </div>\r\n  \r\n  <div ng-show="advancedSearch" class="ui stackable two column grid">\r\n    <div ng-repeat="(key, filter) in ctrl.filters" class="column">\r\n      <h3 class="ui header">\r\n        {{filter.name}}\r\n        <span ng-show="filter.required" class="ui tiny basic red label">Required</span>\r\n      </h3>\r\n      <multi-select ng-model="ctrl.filterValues[key]" options="filter.options" multiple="filter.multiple" required="filter.required"></multi-select>\r\n    </div>\r\n  </div>\r\n  \r\n  <div ng-show="advancedSearch" class="ui stackable two column grid">\r\n    <div ng-repeat="(key, filter) in ctrl.skillFilters" class="column">\r\n      <h3 class="ui header">{{filter.name}}</h3>\r\n      <div class="ui fluid input">\r\n        <input ng-model="ctrl.filterValues.skill[key]" ng-model-options="{ debounce: 500 }" type="text">\r\n      </div>\r\n    </div>\r\n  </div>\r\n  \r\n  <div class="ui stackable one column grid">\r\n    <div class="right aligned column">\r\n      <span class="ui right pointing label">Limit results to:</span>\r\n      <div class="ui mini buttons">\r\n        <button ng-repeat="limit in ctrl.pageLimits" ng-click="ctrl.setPageLimit(limit)" class="ui teal button" ng-class="{ basic: ctrl.pageLimit != limit }">{{limit}}</button>\r\n      </div>\r\n      &nbsp;\r\n      <span class="ui right pointing label">Layout:</span>\r\n      <div class="ui mini icon buttons">\r\n        <button ng-repeat="layout in ctrl.layouts" ng-click="ctrl.layout = layout" class="ui orange button" ng-class="{ basic: ctrl.layout != layout }"><i class="{{layout}} layout icon"></i></button>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  \r\n  <div class="ui divider"></div>\r\n  \r\n  <div class="ui five column doubling grid" ng-show="ctrl.layout == \'grid\'">\r\n    <div ng-repeat="character in ctrl.characters | limitTo: ctrl.pageLimitActual" class="column">\r\n      <a ui-sref="character-details({ characterId: character.id })">\r\n        <character-card ng-model="character" class="ui link"></character-card>\r\n      </a>\r\n    </div>\r\n  </div>\r\n  \r\n  <div ng-show="ctrl.layout == \'list\'">\r\n    <h5>\r\n      Stats are calculated at\r\n      <span class="ui label">level 60</span>\r\n      <span class="ui label">5 superb</span>\r\n      <span class="ui label">+40 bonus stats</span>\r\n    </h5>\r\n    <div class="scrollable table">\r\n      <table class="ui unstackable table">\r\n        <thead>\r\n          <tr>\r\n            <th><a ng-click="ctrl.sortBy = \'name\'">Name <i class="long arrow down icon" ng-show="ctrl.sortBy === \'name\'"></i></a></th>\r\n      \r\n            <th><a ng-click="ctrl.sortBy = \'power\'">Pow <i class="long arrow down icon" ng-show="ctrl.sortBy === \'power\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'technique\'">Tech <i class="long arrow down icon" ng-show="ctrl.sortBy === \'technique\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'vitality\'">Vit <i class="long arrow down icon" ng-show="ctrl.sortBy === \'vitality\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'speed\'">Spd <i class="long arrow down icon" ng-show="ctrl.sortBy === \'speed\'"></i></a></th>\r\n      \r\n            <th><a ng-click="ctrl.sortBy = \'dribble\'">Drb <i class="long arrow down icon" ng-show="ctrl.sortBy === \'dribble\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'defense\'">Def <i class="long arrow down icon" ng-show="ctrl.sortBy === \'defense\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'steal\'">Stl <i class="long arrow down icon" ng-show="ctrl.sortBy === \'steal\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'hp\'">HP <i class="long arrow down icon" ng-show="ctrl.sortBy === \'hp\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'pass\'">Pass <i class="long arrow down icon" ng-show="ctrl.sortBy === \'pass\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'reflex\'">Rflx <i class="long arrow down icon" ng-show="ctrl.sortBy === \'reflex\'"></i></a></th>\r\n            <th><a ng-click="ctrl.sortBy = \'actionSpeed\'">ActSpd <i class="long arrow down icon" ng-show="ctrl.sortBy === \'actionSpeed\'"></i></a></th>\r\n          </tr>\r\n        </thead>\r\n        <tbody>\r\n          <tr ng-repeat="character in ctrl.characters | limitTo: ctrl.pageLimitActual">\r\n            <td>\r\n              <a ui-sref="character-details({ characterId: character.id })">{{character.name.en}}</a>\r\n            </td>\r\n            <td>{{character.primaryStats.power}}</td>\r\n            <td>{{character.primaryStats.technique}}</td>\r\n            <td>{{character.primaryStats.vitality}}</td>\r\n            <td>{{character.primaryStats.speed}}</td>\r\n            \r\n            <td>{{character.secondaryStats.dribble.value}}</td>\r\n            <td>{{character.secondaryStats.defense.value}}</td>\r\n            <td>{{character.secondaryStats.steal.value}}</td>\r\n            <td>{{character.secondaryStats.hp.value}}</td>\r\n            <td>{{character.secondaryStats.pass.value}}</td>\r\n            <td>{{character.secondaryStats.reflex.value}}</td>\r\n            <td>{{character.secondaryStats.actionSpeed.value}}</td>\r\n          </tr>\r\n        </tbody>\r\n      </table>\r\n    </div>\r\n  </div>\r\n</div>'),r.put("routes/rankings/rankings.html",'<h5 class="ui header">\r\n	Show Top {{ctrl.limit}} Players\r\n	<a ng-repeat="limit in ctrl.limits" class="ui label" ng-class="{ \'violet\': limit === ctrl.limit }" ng-click="ctrl.limit = limit">\r\n		{{limit}}\r\n	</a>\r\n</h5>\r\n\r\n<div class="ui stackable doubling four column grid">\r\n	<div ng-repeat="stat in ctrl.stats" class="column">\r\n		<table class="ui unstackable table">\r\n			<thead>\r\n				<tr>\r\n					<th colspan="3">{{ctrl.statNames[stat]}} Ranking</th>\r\n				</tr>\r\n			</thead>\r\n			<tbody>\r\n				<tr ng-repeat="character in ctrl.ranking[stat]" ng-show="$index < ctrl.limit">\r\n					<td>{{character[stat].ranking}}</td>\r\n					<td><a ui-sref="character-details({characterId: character.id})">{{character.name.en}}</a></td>\r\n					<td>{{character[stat].max}}</td>\r\n				</tr>\r\n			</tbody>\r\n		</table>\r\n	</div>\r\n</div>'),r.put("routes/spirit-stones/spirit-stones.html",'<h1 class="ui header">Spirit Stones</h1>\r\n<h3 class="ui header">Name</h3>\r\n<div class="ui fluid input">\r\n	<input ng-model="ctrl.filterValues.name" ng-model-options="{ debounce: 500 }" type="text">\r\n</div>\r\n<br>\r\n\r\n<div class="ui stackable two column grid">\r\n	<div ng-repeat="(key, filter) in ctrl.filters" class="column">\r\n		<h3 class="ui header">\r\n			{{filter.name}}\r\n		</h3>\r\n		<multi-select ng-model="ctrl.filterValues[key]" options="filter.options"></multi-select>\r\n	</div>\r\n	\r\n	<div class="column">\r\n		<h3 class="ui header">Skill</h3>\r\n		<div class="ui fluid input">\r\n			<input ng-model="ctrl.filterValues.skill" ng-model-options="{ debounce: 500 }" type="text">\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class="ui divider"></div>\r\n\r\n<div class="ui stackable doubling three column grid">\r\n	<div ng-repeat="stone in ctrl.spiritStones" class="column">\r\n		<div class="ui segment">\r\n			<div class="ui grid">\r\n				<div class="four wide column">\r\n					<div class="stackable images">\r\n						<img ng-src="{{stone.iconImage}}">\r\n						<img ng-show="stone.zodiacImage" ng-src="{{stone.zodiacImage}}">\r\n					</div>\r\n				</div>\r\n				<div class="twelve wide column">\r\n					<h5 class="ui header">{{stone.name.en}}</h5>\r\n					<div ng-repeat="skill in stone.skills">\r\n						<character-skill ng-model="skill"></character-skill>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>')}]);